import React from 'react'
import "./Home.css";

export default function Home() {
  return (
    <div className='home'>
    <div className="container">
    <h3 className='heading'>Let's Make The World Better Place</h3>
    <div className="btns">
    <button className='btn1'>Donate</button>
    <button className='bt2'>Seek Help</button>
    </div>
    </div>
    </div>
  )
}
